Assay Description:
293 T effector cells were transfected with plasmid pAAV-IRES-EGFP encoding the EGFP (293 T/EGFP cells) or plasmid pAAV-IRES-S-EGFP encoding the corresponding HCoV S protein (293 T/HCoV S/GFP cells) as the effector cells. Huh-7 cells, expressing various HCoV receptors on the membrane surface, were used as target cells, as described below.

1) MERS-CoV S-mediated cell-cell fusion: Effector cells (293 T/MERS-CoV/GFP) and target cells (Huh-7 cells) were cocultured in DMEM containing 10% FBS, at 37～C for 2 hours;

2) 229E S-mediated cell-cell fusion: Effector cells (293 T/229E/GFP) and target cells (Huh-7 cells) were cocultured in DMEM containing 10% FBS, at 37～C for 4 hours;

3) SARS-CoV and SL-CoV S-mediated cell-cell fusion: Effector cells (293 T/SARS-CoV/GFP or 293 T/SL-CoV/GFP) and target cells (Huh-7 cells) were cocultured in the presence of trypsin (80 ng/ml) in DMEM without FBS, at 37～C for 4 hours;

4) OC43 or NL63 S-mediated cell-cell fusion: Effector cells (293 T/HCoV-OC43/GFP or 293 T/HCoV-NL63/GFP) and target cells (Huh-7 cells) were cocultured in the presence of trypsin (80 ng/ml) in DMEM without FBS, at 37～C for 4 hours.

Five fields in each well were randomly selected for counting the fused and unfused cells. The fused cells are at least twice as large as the unfused cells, and the fluorescence intensity in the fused cell became weak as a result of the diffusion of enhanced green fluorescent protein (EGFP) from one effector cell to target cells (see figs. S1D and S2C). The percentage of cell-cell fusion [(number of the fused cells/number of the fused and unfused cells) ℅ 100%] was then calculated.

